const range = len => {
  const arr = []
  for (let i = 0; i < len; i++) {
    arr.push(i)
  }
  return arr
}

const newPerson = () => {
  const statusChance = Math.random()
  return {
    id: namor.generate({ words: 1, numbers: 0 }),
    title: namor.generate({ words: 1, numbers: 0 }),
    dateCreate: Math.floor(Math.random() * 30),
    numberOfLessons: Math.floor(Math.random() * 100),
    totalOfViews: Math.floor(Math.random() * 100),
    status:
      statusChance > 0.66
        ? 'relationship'
        : statusChance > 0.33
        ? 'complicated'
        : 'single',
  }
}

